export const ui_nav = (value) => {
    return {
        type: 'UI_NAV',
        payload: value
    };
};

export const ui_sidebar = () => {
    return {
        type: 'UI_SIDEBAR'
    };
};

export const auth_isregister = () => {
    return {
        type: 'AUTH_ISREGISTER'
    };
};

export const auth_isforgotpassword = () => {
    return {
        type: 'AUTH_ISFORGOTPASSWORD'
    };
};
